import React from "react";
import "../styles/pages/approach.scss";


const Approach = () => {
  return (
    <section className='main'>
      <div className='container'>
        <div className='row'>
        <h2>
            <div className='line'>
              <span>Hello, We're GlobalxSolutions</span>
            </div>
            <div className='line'>
              <span>Software development & design teams</span>
            </div>
          </h2>
        </div>
      </div>
    </section>
  );
};

export default Approach;
